(2844, 1091, 401, 1, '時間沒有等我', '', '2005-09-11 00:00:00', 0000, 25, 0, 5, '', '下午懶洋洋 不太習慣 電話故障\n葉子掉了幾片？喔 兩片\n我才發現 已經是秋天 窗外風涼涼\n電話沒壞 只是沒有響\n我忽略了時間 沒發現 一個人走過幾個月\n打開了門 探出了頭\n才發現我的生活 被丟棄在家門口\n下午懶洋洋 手機打開 也沒有留話\n我伸一伸懶腰 哈啾！\n我才發現 已經是冬天\n\n(怎能怪)時間沒有等我\n是我忘了跟著走 捨不得溫暖的被窩\n想念你的溫柔 (怎能怪)時間沒有等我 是你忘了帶我走\n雖然我沒改變 卻想不起你的面孔 時間沒有等我\n回頭對我冷嘲熱諷 我換好了球鞋\n決定要追上一切 在春天來臨以前', 265, '', 'ciacia', 'ciacia', '穗好', 'NAOM', '', 1, 1, 0, '2008-05-05 11:15:20', '2015-03-12 13:31:29', '0000-00-00 00:00:00'),
