(2855, 33, 403, 1, '空中飛人', '', '2008-05-05 00:00:00', 0000, 10, 0, 7, '漫遊狂風呼嘯 在高空不會跌下\r\n踩著晃蕩繩索 藍天就是我的家\r\n\r\n因為我是 空中飛人\r\n\r\n萊特兄弟的發明實現了人類的夢想\r\n觸碰它的鼻子 旋轉就能夠翱翔\r\n\r\n全世界渴望 直上雲霄\r\n可是我沒有翅膀 就能飛翔\r\n\r\n用我雙腳 踏在雲彩上\r\n他們見到 就欣喜若狂\r\n可我試著 想要向下爬\r\n否則世界都要變成灰呀啊\r\n\r\n這是我令人羨慕的詛咒\r\n永遠地向上爬升卻不回頭\r\n\r\n變得無二獨一 行走在蒼穹天際\r\n曾經也想卓越 這一切令人著迷\r\n\r\n在迷濛的夜 於是察覺\r\n你習慣的笑顏 消失不見\r\n\r\n用我雙腳 踏在雲彩上\r\n他們見到 就欣喜若狂\r\n可我試著 想要像下爬\r\n否則世界都要變成灰呀啊\r\n\r\n這是我令人羨慕的詛咒\r\n永遠地向上爬升卻不回頭\r\n看著那熟悉面容卻逐漸剝落\r\n別讓我墜落在宇宙\r\n\r\n空中飛人 我閉上雙眼 脫掉我的雙腿 就能墜毀\r\n空中飛人 要回到地面 握著你的手掌 想要迫降\r\n空中飛人 要變得平凡 去享受你的愛 我好期待', '', 250, '', 'Twice a Week', 'Twice a Week', 'Twice a Week', 'Twice a Week', '', 1, 1, 0, '2008-05-05 15:36:23', '2015-03-12 13:31:29', '0000-00-00 00:00:00'),
(2856, 33, 403, 2, 'If I See the Devil', '', '2008-05-05 00:00:00', 0000, 10, 0, 7, 'If I see the devil 怎能停止被剝奪\r\nIf I see the devil 你在夜裡受折磨\r\n\r\n為了你純潔完美無瑕 我承受一切沙漠的風暴\r\n就這麼吹蝕風化殆盡 卻無法再為你繼續承擔遮蔽\r\n\r\nAnd I dream the nightmare 我瘋狂用力追逐著\r\nAnd I dream the nightmare 你沒命痛苦哀嚎著\r\n\r\n我一轉身回頭就被 紅色的傷心平原所淹沒\r\n在那裡吶喊狂叫無助 無聲尖叫撕裂希望\r\n\r\n別再奪走我一切 讓我體無完膚還不夠\r\n不要踐踏我的心 我的尊嚴我的真愛 \r\n\r\nIf I see the dark night 睜開眼以為醒來\r\nIf I see the dark night 原來噩夢離不開\r\n\r\n我一轉身回頭就被 紅色的傷心平原所淹沒\r\n在那裡吶喊狂叫無助 無聲尖叫撕裂希望\r\n\r\n別再奪走我一切 讓我體無完膚還不夠\r\n不要踐踏我的心 我的尊嚴我的真愛 \r\n\r\n拖著千瘡百孔的身體\r\n我殘廢了 但前進著\r\n(我前進著 前進著)\r\n\r\n在他眼中沒有憐憫 在我面前只剩空氣\r\n最初的你要去哪裡 你我倆相依為命\r\n\r\n', '', 273, '', 'Twice a Week', 'Twice a Week', 'Twice a Week', 'Twice a Week', '', 1, 1, 0, '2008-05-05 15:41:03', '2015-03-12 13:31:29', '0000-00-00 00:00:00'),
(2857, 33, 403, 3, '新世紀冒險家', '', '2008-05-05 00:00:00', 0000, 0, 1, 7, '新世紀的冒險家 浮游在藍色水族箱\r\n嘴巴還含著棒棒糖 卻忘記童年的模樣\r\n\r\n把戰鬥裝備穿上 操控我的鐵金剛\r\n拯救地球我來啦\r\n\r\n別被遺棄 我就必須 調皮搗蛋 拼命製造麻煩\r\n需要憐愛 我就還在 黑名單上 被紅筆圈起來\r\n\r\n舊時代溫室花瓣 飄落在肺泡末端\r\n在氣管裝模作樣 卻忘記枯萎的黯淡\r\n\r\n把戰鬥裝備穿上 操控我的鐵金剛\r\n拯救地球我來啦\r\n\r\n別被遺棄 我就必須 調皮搗蛋 拼命製造麻煩\r\n需要憐愛 我就還在 黑名單上 被紅筆圈起來\r\n\r\n為什麼媽媽不來接我 我可是全世界的英雄\r\n為什麼媽媽不來接我 我可是全世界的英雄\r\n\r\n別被遺棄 我就必須...\r\n需要憐愛 我就還在...\r\n\r\nI have no choice so I have to..\r\n\r\n', '', 235, '', 'Twice a Week', 'Twice a Week', 'Twice a Week', 'Twice a Week', '', 1, 1, 0, '2008-05-05 15:45:04', '2015-03-12 13:31:29', '0000-00-00 00:00:00'),
(2858, 33, 403, 4, '一個人的生活', '', '2008-05-05 00:00:00', 0000, 10, 0, 7, '你迎接的 是甚麼夜晚\r\n空蕩蕩的床鋪 還少了點溫度\r\n\r\n我總是無法跟上你感受的影子\r\n我總是無法融入你纖細的樣子\r\n\r\n你期待的 是甚麼早晨\r\n細雨綿綿的天氣 和溼答答的帆布鞋\r\n\r\n你用甚麼 顏色粉刷\r\n要我別走的黑夜\r\n熟睡的你在床上而我悄悄離開\r\n\r\n我總是無法跟上你感受的影子\r\n我總是無法融入你纖細的樣子\r\n\r\n不該讓你一個人\r\n一個人的生活著\r\n在這個灰色的世界裡 用盡顏料', '', 350, '', 'Twice a Week', 'Twice a Week', 'Twice a Week', 'Twice a Week', '', 1, 1, 0, '2008-05-05 15:50:46', '2015-03-12 13:31:29', '0000-00-00 00:00:00'),
